const listHTML = function (list,channel) {
    return new Promise((resolve, reject) => {
      let thumbnail;
      getSpecifiedData('videos', 'id', list.videos[0].id)
        .then(data => {
          thumbnail = data.thumbnail;
          resolve(getHTML(thumbnail)); // Resolve the promise with the HTML content
        })
        .catch(error => {
          reject(error); // Reject the promise if there's an error
        });
    });
  function getHTML(thumbnail) {
    return `
    <div class="list clickable">
      <div class="top">
        <a href="playlist.html?list=${list.id}">
        <div class="img">
          <img src="${thumbnail}" alt="" />
        </div>
        <div class="first-shadow shadow">
          <img src="${thumbnail}" alt="" />
        </div>
        <div class="second-shadow shadow">
          <img src="${thumbnail}" alt="" />
        </div>
        <div class="list-videos-count">
          <div class="svg">
            <svg
              xmlns="http://www.w3.org/2000/svg"
              height="24"
              viewBox="0 0 24 24"
              width="24"
              focusable="false"
            >
              <path
                d="M22 7H2v1h20V7zm-9 5H2v-1h11v1zm0 4H2v-1h11v1zm2 3v-8l7 4-7 4z"
              ></path>
            </svg>
          </div>
          <div class="text">
            <p><span id="videosCount">${list.videos.length}</span> videos</p>
          </div>
        </div>
        <div class="hover-play-all">
          <div class="svg">
            <svg
              xmlns="http://www.w3.org/2000/svg"
              height="24"
              viewBox="0 0 24 24"
              width="24"
            >
              <path d="m7 4 12 8-12 8V4z" />
            </svg>
          </div>
          <div class="text">
            <p>Play all</p>
          </div>
        </div>
      </a>
      </div>
      <div class="bottom">
        <a href="watch.html?video=${list.videos[0].id}&list=${list.id}">
        <div class="list-name">
          <p id="list-name">${list.name}</p>
        </div>
        <div class="list-info">
          <div class="list-owner">
            <a href="channel.html?user=${channel.user}" id="listChannel"><span>${channel.name}</span></a>
          </div>
          <div class="list-extra-info">
            <span class="dot-style"></span>
            <span>Playlist</span>
          </div>
        </div>
        <div class="view-list">
          <a href="playlist.html?list=${list.id}"><span>view full playList</span></a>
        </div>
        </a>
      </div>
  </div>`
  }
}
